import { Injectable , of} from "@angular/core";
import { BehaviorSubject } from "rxjs";

@Injectable()
export class artistasServices{

    constructor(){}

    artistas: Artistas[] = [ ];

    public signArtists(idArtista:number, nombreArtista:string, fechaDeRegistro:string , estiloMusical:string, correo:string, telefono:number, mensaje:string):Observable<Artistas []> {
        if(idArtista != "" && nombreArtista != "") {
            this.artistas.push({idArtista:idArtista, nombreArtista:nombreArtista, fechaDeRegistro:fechaDeRegistro, estiloMusical:estiloMusical, correo:correo, telefono:telefono, mensaje:mensaje });
        } return of(this.artistas);
        }
    }

export interface Artistas {idArtista:number, nombreArtista:string, fechaDeRegistro:string , estiloMusical:string, correo:string, telefono:number, mensaje:string}
